ObjC.import('stdlib')


function run(argv) {
    var app = Application.currentApplication()
    app.includeStandardAdditions = true

    let path = $.getenv('MyPKMPath')
    var query = argv[0]
	var file = `${path}/pages/${argv[0]}`
    console.log("__file name:: " + file)

    function readFile(file) {
        // Convert the file to a string
        var fileString = file.toString()

        // Read the file and return its contents
        return app.read(Path(fileString))
    }

    let match = readFile(file).match(/title::.*\n/)

    console.log("__match file name with title props:: " + file)


    let return2; 

    if (match != null) {
	return2 = match[0].replace("title::", "").trim()
    }
    else {
	    return2= argv[0]
    }

    if (return2.includes("___")) {
    		return2 = return2.replace("___", "/");
	}

    console.log("__tile name:" + return2)

    let title = path.split("/")
    let titleFinal = title[title.length -1]

    return(`logseq://graph/${titleFinal}?page=${return2.replace(".md", "")}`)
}

ObjC.import('stdlib')

function run(argv) {

	let path = $.getenv('MyPKMPath')

	let secondPath = `${path}/pages`
	  var query = argv[0];
		let items = {"items": []}
	function getAllFiles(){
		let files = Application('System Events').folders.byName(secondPath).diskItems.name()
		for (const x in files){
			if (files[x].toLowerCase().includes(argv[0].toLowerCase())){
				items.items.push({"title": files[x], "subtitle": files[x], "arg": files[x]})
			}
		}
	}
	getAllFiles()
	return(JSON.stringify(items));
}

