# function from https://gist.github.com/lukechilds/a83e1d7127b78fef38c2914c4ececc3c
Get-LatestRelease() {
  curl --silent "https://api.github.com/repos/logseq/logseq/releases/latest" | # Get latest release from GitHub api
    grep '"tag_name":' |                                            # Get tag line
    sed -E 's/.*"([^"]+)".*/\1/'                                    # Pluck JSON value
}

Get-LatestRelease
